import React, {Component} from 'react'
import {Link} from "react-router-dom"
import './Components.css'

class LandingPage extends Component {
    render() {
        return (
            <div>
                <h1>Artist Search</h1>
            <div>
                <button><Link to="/homepage">Enter</Link></button>
            </div>
            </div>
        )
    }
}

export default LandingPage
